// read the 'list'-parameter from the URL (provided by proliferate)
function getParameterByName(name) {
    const url = new URL(window.location.href);
    return url.searchParams.get(name);
}

// get the required list based on the 'list'-parameter
const selectedListName = getParameterByName("list");

if (selectedListName && lists[selectedListName]) {
    var items = lists[selectedListName];
    console.log("Loaded list:", selectedListName); // Hier wird die richtige Liste geladen
} else {
    alert("Invalid or missing list parameter. Please provide a valid 'list' parameter in the URL.");
}
    
//-----------------------------------------------------
function create_Arrays() {
	let arr_img = [];
	let arr_combined = [];
	for (let i = 0; i < items.length; i++) {
		arr_combined.push(items[i]);
		if (items[i].Trial_cat==='Dis') {
			for (let j = 0; j < images.length; j++) {
        //console.log(images[j].toLowerCase(),items[i].Word1.toLowerCase(),items[i].Word2)
				if (images[j].toLowerCase().includes(items[i].Word1.toLowerCase()) && images[j].toLowerCase().includes(items[i].Word2.toLowerCase())) {
					let img_trial = { 
						Img: `<img src="distractors/${images[j]}" style="height:400px"></img>`,
						Trial_cat: 'Dis_pic', 
						Trial_no: items[i].Trial_no,  
						Cat_comb_type: items[i].Cat_comb_type, 
						Word1: items[i].Word1, 
						Word2: items[i].Word2, 
						Gender_comb: items[i].Gender_comb,
						Cat_comb: items[i].Cat_comb,
						Type: jsPsychSurveyMultiChoice,
					};
					arr_img.push(img_trial);
					arr_combined.push(img_trial);
				}
			}
		}
	}

	//return [arr_img,arr_combined];
	return [arr_combined,arr_img];
}

